const ContactList = () => {
    const contacts = [{
        fistName:'Ruchika',
        lastName:'Bharati',
        contactNumber:'+9373431164'
    },{
        fistName:'Snahal',
        lastName:'Falake',
        contactNumber:'+1234567872'
    },{
        fistName:'Poonam',
