        contactNumber:'+9373431164'
    },{
        fistName:'Yogesh',
        lastName:'Bharati',
        contactNumber:'+9373431164'
    },{
        fistName:'Mahesh',
        lastName:'Bharati',
        contactNumber:'+9373431164'
    },{
        fistName:'Sandesh',
        lastName:'Bharati',
        contactNumber:'+9373431164'
    },{
        fistName:'Dinesh',
        lastName:'Bharati',
        contactNumber:'+9373431164'
    }]
    const [contactList,setContactList] = useState(contacts)
 return(<>
 <table className="table">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">Name</th>

    </tr>
  </thead>
  <tbody>
    {contactList.map((contact,index)=>{
         return (<tr>
            <th scope="row">{index+1}</th>
            <td>
                <Link>{contact.fistName}</Link>
            </td>

          </tr>)
    })}
  </tbody>
  </table>
 </>)
}
export default ContactList;
